      base_stat: stat.base_stat,
      name: stat.stat.name
    }
    arr.push(tempObj)
  }
  return arr
}

export const getTypes = (type: any) => {
  return type.length > 1 ? {
    typeOne: type[0].type.name,
    typeTwo: type[1].type.name
  } : {
    typeOne: type[0].type.name
  }
}
